// CreateTask.js
import React, { useState, useEffect } from 'react';

const CreateTask = () => {
  const [taskName, setTaskName] = useState('');
  const [progress, setProgress] = useState('Not Started');
  const [description, setDescription] = useState('');
  const [creationDate, setCreationDate] = useState('');
  const [dueDate, setDueDate] = useState('');
  const [priority, setPriority] = useState('Low'); // Initialize with default priority

  useEffect(() => {
    const today = new Date().toISOString().split('T')[0];
    setCreationDate(today);
  }, []);

  const handleTaskNameChange = (e) => {
    setTaskName(e.target.value);
  };

  const handleProgressChange = (e) => {
    setProgress(e.target.value);
  };

  const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
  };

  const handleDueDateChange = (e) => {
    setDueDate(e.target.value);
  };

  const handlePriorityChange = (e) => {
    setPriority(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log({
      taskName,
      progress,
      description,
      creationDate,
      dueDate,
      priority,
    });
  };

  return (
    <div>
      <h2>Create Task</h2>
      <form onSubmit={handleSubmit}>
        <label>
          Task Name:
          <input type="text" name="name" value={taskName} onChange={handleTaskNameChange} />
        </label>
        <br />
        <label>
          Progress on Completion:
          <select value={progress} onChange={handleProgressChange}>
            <option value="Not Started">Not Started</option>
            <option value="In Progress">In Progress</option>
            <option value="Needs Review">Needs Review</option>
            <option value="Done">Done</option>
          </select>
        </label>
        <br />
        <label>
          Description:
          <textarea name="description" value={description} onChange={handleDescriptionChange} />
        </label>
        <br />
        <label>
          Creation Date:
          <input type="date" name="creationDate" value={creationDate} readOnly />
        </label>
        <br />
        <label>
          Due Date:
          <input type="date" name="dueDate" value={dueDate} onChange={handleDueDateChange} />
        </label>
        <br />
        <label>
          Priority:
          <select value={priority} onChange={handlePriorityChange}>
            <option value="Low">Low</option>
            <option value="Medium">Medium</option>
            <option value="High">High</option>
            <option value="Critical">Critical</option>
          </select>
        </label>
        <br />
        <button type="submit">Create</button>
      </form>
      <div>
        <p>Current Progress: {progress}</p>
      </div>
    </div>
  );
};

export default CreateTask;
